import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
function Plan() {
  const [getplan, setPlan] = useState({});
  console.log("hi1111111");
  useEffect(() => {
    async function getAllPlan() {
      try {
        const plandata = await axios.get("http://127.0.0.1:8000/list/");
        console.log("hi222222222222");
        console.log(plandata.data);
        setPlan(plandata.data);
      } catch (error) {
        console.log(error);
      }
    }
    getAllPlan();
  }, []);
  <h1>Connect with Django</h1>;
  return (
    <div>
      <h6>Item List Data from Django</h6>
      {console.log("getplan", getplan)}
      {getplan?.map((items, i) => {
        return (
          <div>
            {/* <h2 key={i}>{items.item}</h2> */}
            <div class="table table-bordered border-primary">
              <table class="table" align="left">
                <td>{items.id}</td>
                <td>{items.item}</td>
              </table>
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default Plan;
